import {configureStore} from '@reduxjs/toolkit'
import { currentScrollingLevelSlice, heroBannerHeightSlice , outOfInkBgSlice, getLocationSlice } from './reducers'

const store = configureStore({
    reducer:{
        currentScrollingLevel: currentScrollingLevelSlice.reducer,
        heroBannerHeight: heroBannerHeightSlice.reducer,
        outOfInkBg: outOfInkBgSlice.reducer,
        getLocation: getLocationSlice.reducer,
    }
})

export default store
